	["am_zebra_dark"] = { name = "어두운 수면", desc = "이 총기는 크롬 코팅제를 칠한 뒤 각각 다양한 반사도를 지닌 흑연빛 메탈릭 도료로 물을 연상시키는 무늬가 도색되었습니다.\n\n물은 생명의 근원이기도 하지만, 도리어 생명을 앗아가기도 한답니다…." },
