	["am_fuschia"] = { name = "진분홍은 지금이다", desc = "이 총기는 크롬 코팅제를 칠한 뒤 선명한 진분홍 색과 흑연 도장 처리 효과 페인트로 도색되었습니다." },
	["aq_etched_cz75"] = { name = "빅토리아", desc = "이 총기는 황금색을 강조색으로 하여 두루마리 무늬를 새겨넣어 도색하였습니다." },
	["am_p250_beaded_paint"] = { name = "역류", desc = "이 총기는 파란색과 검은색 메탈릭 페인트를 이용해 점박무늬를 만들었으며 슬라이드를 은색 메탈릭 페인트로 도색하였습니다." },
	["am_fluted_tec9"] = { name = "티타늄 비트", desc = "이 총기의 총신은 도장 처리를 통해 로열 블루 색을 띠고 있으며 세로로 기울어진 줄무늬가 그어져 있습니다." },
