	["so_panther"] = { name = "표범", desc = "이 총기는 흑색, 회색 그리고 붉은색의 색채 배합으로 도색되어 있습니다." },
	["aq_usp_stainless"] = { name = "스테인리스", desc = "이 총기는 스테인리스강으로 만들어진 슬라이드를 사용합니다." },
	["hy_craquelure"] = { name = "푸른 균열", desc = "수전사공법을 통해 갈라진 지면을 연상시키는 무늬를 도색했습니다." },
	["hy_poly_camo"] = { name = "붉은색 FragCam", desc = "수전사공법을 통해 다각형이 두드러진 위장 무늬를 도색했습니다." },
	["hy_poly_camo_desert"] = { name = "사막 위장용 FragCam", desc = "hy_poly_camo_desert" },
