	["sp_spray_waves_bravo"] = { name = "sp_spray_waves_bravo", desc = "해안에서 가져온 이 기념품은 대조되는 색깔의 짧고 굵은 선 무늬가 스프레이를 통해 도색되었습니다.\n\n자주 이동하는 폭도라면 꼭 필요함" },
	["hy_ocean_bravo"] = { name = "hy_ocean_bravo", desc = "이 해안에서 가져온 기념품에는 수전사공법을 통해 푸른색의 위장무늬를 도색하였습니다.\n\n우리가 사는 세상에서는 위장이 중요하지... 하지만 가끔씩 위장이 일부러 보이도록 할 때도 있어 - 부스 , 무기 상인" },
	["sp_spitfire_famas_bravo"] = { name = "sp_spitfire_famas_bravo", desc = "무기창고에서 가져온 이 기념품은 총기의 앞부분이 전투기의 코 부분에 도색되는 상어의 입을 연상시키도록 도색되었습니다.\n\n제스터는 죽었어" },
	["hy_tile_bravo"] = { name = "hy_tile_bravo", desc = "알리에서 가져온 이 기념품은 수전사공법으로 모자이크 무늬를 도색하였습니다.\n\n인내심은 미덕이다" },
	["an_navy_bravo"] = { name = "an_navy_bravo", desc = "알리에서 가져온 이 기념품은 크롬 코팅제를 칠한 뒤 선명한 군청색 도장 처리 효과 페인트로 도색하였습니다.\n\n난 이미 한 명을 발레리아의 거짓말에 잃었다... 더 이상의 피해는 용납할 수 없다 - 펠릭스 라일리, 지휘관" },
	["sp_hazard_bravo"] = { name = "sp_hazard_bravo", desc = "시즈에서 가져온 이 기념품은 경고 표시가 연상되는 줄무늬로 도색하였습니다.\n\n건너지 말 것" },
	["sp_tape_dots_bravo"] = { name = "sp_tape_dots_bravo", desc = "괄리오르에서 가져온 이 기념품은 테이프 조각과 원 모양의 구멍이 뚫린 철판을 이용한 스텐실 기법으로 도색하였습니다.\n\n걱정 마... 내 사업은 슬슬 번창하고 있으니 - 부스, 무기 상인" },
	["sp_palm_bravo"] = { name = "sp_palm_bravo", desc = "괄리오르에서 가져온 이 기념품은 골판지 조각과 촘촘한 격자 그리고 야자수 잎을 이용한 스텐실 기법으로 도색되었습니다.\n\n오늘은 아름답지만 내일은 재가 되어버린다" },
	["hy_ddpat_bravo"] = { name = "hy_ddpat_bravo", desc = "폐허에서 가져온 이 기념품에는 디지털 위장 무늬(DDPAT)를 수전사공법을 통해 도색하였습니다.\n\n보이지 않아도 반드시 들을 수는 있을 것이다" },
	["so_jungle_bravo"] = { name = "so_jungle_bravo", desc = "폐허에서 가져온 이 기념품의 부품은 열대림을 연상시키는 색상 배합의 단색으로 도색되어 있습니다.\n\n파괴를 좋아하는 사람들을 위해	" },
	["so_tornado_bravo"] = { name = "so_tornado_bravo", desc = "알리에서 가져온 이 기념품은 폭풍을 연상시키는 색채의 배합으로 도색되어 있습니다.\n\n말은 바람이 되지만, 바람이 사람을 죽일 수 있다" },
	["so_sand_bravo"] = { name = "so_sand_bravo", desc = "괄리오르에서 가져온 이 기념품에는 모래 사장을 연상시키는 색채 배합으로 도색되어 있습니다.\n\n알렉스 킨케이드 기자가 선봉대 작전을 취재하기 위해 마그레브로 떠난 후 실종됐다는 소식이 들어왔습니다" },
	["so_olive_bravo"] = { name = "so_olive_bravo", desc = "무기창고에서 가져온 이 기념품은 황록색의 색채 배합으로 도색되어 있습니다.\n\n승리했다고 안심하면 안 된다" },
	["an_gunmetal_bravo"] = { name = "an_gunmetal_bravo", desc = "시즈에서 가져온 이 기념품은 크롬 코팅제를 바른 뒤 탁한 청회색 도장 처리 효과 도료로 도색하였습니다.\n\n넌 나보다 펠릭스 라일리를 잘 몰라... 그 놈은 꺾을 수 없어 - 배신자와 진실의 추적자 1장" },
	["am_ossify_blue_p2000_bravo"] = { name = "am_ossify_blue_p2000_bravo", desc = "이 해안에서 가져온 기념품은 메탈릭 코팅제를 칠한 뒤 선명한 파란색의 추상적인 무늬를 도색하였습니다. \n\n파도가 부서진다. 우리의 다짐은 부서지지 않는다. - 코타로 이자키, 파괴 전문가" },
	["am_crumple_bravo"] = { name = "am_crumple_bravo", desc = "에이전시에서 가져온 이 기념품은 크롬 코팅제를 칠한 뒤 각각 다른 반사도를 지닌 메탈릭 페인트를 이용해 다각형 무늬로 도색하였습니다.\n\n연필 내리고, 손 들어!" },
	["aq_steel"] = { name = "aq_steel", desc = "외관만 녹슬었을 뿐 완벽하게 작동합니다.\n\n어떤 사람들은 자신의 행동이 얼마나 더러운 지 숨길 필요를 느끼지 않는다" },
	["hy_hex"] = { name = "hy_hex", desc = "이 총기에는 육각형 무늬를 수전사공법을 통해 도색하였습니다." },
	["hy_camo_large"] = { name = "hy_camo_large", desc = "이 총기는 수전사공법으로 일부분이 비대한 위장 무늬를 도색하였습니다." },
	["am_ddpatdense"] = { name = "am_ddpatdense", desc = "이 총기는 디지털 위장 무늬가 전사되어 있고 메탈릭 도료가 첨가된 포일이 씌워져 있습니다." },
	["twigs"] = { name = "twigs", desc = "이 총기는 나뭇가지를 이용한 스텐실 무늬를 스프레이로 도색하였습니다." },
	["varicamo"] = { name = "varicamo", desc = "이 총기는 수전사공법으로 VariCamo 위장 무늬를 도색하였습니다.\n\n재건은 파괴의 잔해 위에서만 이뤄질 수 있다" },
	["aq_damascus_knife"] = { name = "aq_damascus_knife", desc = "두 가지 탄소강으로 만든 철판에서 제련되었습니다.\n\n마침내 당신의 결의에 맞는 강력한 무기가 마련되었습니다." },
	["am_crystallized"] = { name = "am_crystallized", desc = "금속성 도료를 특수처리하여 무늬를 만들었습니다.\n\n모두가 깊은 인상을 주고 싶어하지" },
	["snakeskin"] = { name = "snakeskin", desc = "이 총기는 뱀의 피부를 연상시키는 무늬를 수전사공법으로 도색하였습니다. \n\n네가 조직을 믿지 못하는 걸 알고 있어. 그리고 내가 너를 노출시키면 발레리아는 너를 죽일거야. - 방패 조직과 뱀 조직 제 1장	" },
	["cu_usp-s_elegant"] = { name = "cu_usp-s_elegant", desc = "슬라이드가 스텐실 기법을 통해 넣은 대테러리스트 문양과 코발트 블루색으로 도색되어 있습니다.\n\n작전에 따라 행동해서 7명을 구출하거나, 내 방식대로 해서 10명을 모두 구출할 수 있지... 결정해라 - 카르멘 코시네로, 인질 구출 전문가" },
	["hy_plaid2"] = { name = "hy_plaid2", desc = "회갈색과 파란색 색채의 녹색을 사용한 격자 무늬를 수전사공법을 통해 도색했습니다.\n\n백파이프는 아니지만 누군가의 장례식이 올 때마다 연주를 하더군요" },
	["cu_fiveseven_urban_hazard"] = { name = "cu_fiveseven_urban_hazard", desc = "도시 위장색과 빨간 강조점으로 도색되었습니다.\n\n부스는 매년 세계 각지에서 최고의 총기 제작가들을 모아 그들의 새 디자인을 선보입니다" },
	["an_emerald"] = { name = "an_emerald", desc = "크롬 베이스 코팅제를 씌운 뒤 투명한 에메랄드색의 표면 처리 효과 도료로 마무리 했습니다.\n\n이게 세바스찬 헤네켓라고? 잔소리만 해대는 학교 선생님? 대체 무슨 일이 있었던 건가... - 스승과 우상 파괴자 2장" },
	["so_keycolors"] = { name = "so_keycolors", desc = "각 부품을 선명한 색채의 파란색과 주황색 스프레이로 도색했습니다.\n\n위대한 심판자" },
	["cu_awp_mastery"] = { name = "cu_awp_mastery", desc = "수전사공법으로 전사하고 세밀한 스텐실공법으로 도색하였으며 열전사 데칼로 장식했습니다. \n\n체이스 터너는 대단한 인물이었어. 따라가려면 멀었다고. - 불사조와 신입, 제 1장" },
	["aq_dualberettas_cartel"] = { name = "aq_dualberettas_cartel", desc = "뱀과, 꽃, 해골들이 새겨져 있습니다.\n\n양 손에 무기가 있더라도 뒤는 항상 조심해야 한다... - 뱀과 진리 탐구자, 제 2장" },
	["aq_famas_contour"] = { name = "aq_famas_contour", desc = "빨간색과 회색으로 무기의 형태를 돋보이게 하는 현대적인 무늬가 도색되어 있습니다.\n\n우리는 함께하면 항상 강합니다" },
	["cu_nova_hyperbeast"] = { name = "cu_nova_hyperbeast", desc = "흉칙한 괴물이 환상적인 색채로 도색되어 있습니다. \n\n사람들이 널 오니라고 부르지?  불쌍한 남자에게 너무나 무서운 이름이군... – 엘리엇 킹스맨, 용병" },
	["hy_ocean_knife"] = { name = "hy_ocean_knife", desc = "수전사 공법으로 파란색 위장 무늬가 도색되어 있습니다." },
	["cu_m4a1s_printstream"] = { name = "cu_m4a1s_printstream", desc = "It has been custom painted with a stark black and white design and finished with pearlescent highlights.\n\nWHITE_1; BLACK_1; PEARLESCENT_1; SILENCED_1;" },
	["cu_usp_printstream"] = { name = "cu_usp_printstream", desc = "It has been custom painted with a stark black and white design and finished with pearlescent highlights.\n\nWHITE_1; BLACK_1; PEARLESCENT_1; SILENCED_1; PISTOL_1;" },
